import './NavigationWeatherForecast.css'
import { NavLink } from 'react-router-dom'

export default function NavigationWeatherForecast() {

    return (
    <nav>
        <ul className='navigation-weather-forecast'>
            <li><NavLink to='/weather-forecast'>4 days</NavLink></li>
            <li><NavLink to='/weather-forecast/8days'>8 days</NavLink></li>
            <li><NavLink to='/weather-forecast/12days'>12 days</NavLink></li>
            <li><NavLink to='/weather-forecast/16days'>16 days</NavLink></li>
        </ul>
    </nav>
    )
}


